                "title": "Blu Anchor Creations",
                "announcement": "Welcome to Blu Anchor Creations! We hope you enjoy what you see. Please take your time and look around the shop. All of the items in this shop are made with professional grade, permanent adhesive vinyl. If there is something you don&#39;t see in our store please contact us and we are more than happy to create something with you! Have a wonderful day!\n\n**Our current turn around time is 1-2 weeks. Please check individual listings for shipping time frames.**",
                "currency_code": "USD",
                "is_vacation": false,
                "vacation_message": "ANY ORDERS DUE TO SHIP OUT ON THE 15th WILL SHIP OUT NO LATER THAN THE 18th. If you have any questions please feel free to write us. We are working very hard to get everything out in time for Christmas. :)\r\n\r\nWelcome to Blu Anchor Creations! We are currently not taking orders at the moment. If you have an order with us we will get them out as fast as possible. Our deadline for Christmas orders is the 14th so if you placed your order before than it will be going out very soon. Please contact us with any questions or concerns and we will get back to you as soon as possible.",
