                "policy_welcome": "Welcome to Blu Anchor Creations! We hope you enjoy what you see. Please take your time and look around the shop. If there is something you don&#39;t see in our store please contact us and we are more than happy to create something with you!",
                "policy_payment": "â¥PAYMENTS\nWe accept all cards through Etsy website, Etsy gift cards, and Paypal.",
                "policy_shipping": "â¥TURN AROUND TIME\nAll order are shipped within 1-2 weeks of placing your order. Please make sure all your information is correct to avoid any delays. \n\nPlease message us if you need a rush order and we will be happy to try and accommodate. If you do not message us before placing an order needed before our set production time we will  not responsible if the item does not reach you in time, PLEASE message us before and we will be more than happy to rush your order!\n\nWe ship all orders via USPS, you will be emailed a tracking number when item is shipped.\n\nWe am not responsible for packages once they are in the hands of the postal service, however if your item arrives broken or damaged in any way we will be happy to replace the item for you. We will ship replacement items priority 2-3 day shipping. We will need CLEAR and detailed pictures of the broken items! That is very important. \n\nIf an item gets returned because of an incorrect address than another shipping label will need to be purchased by seller even if item was purchased with FREE shipping. We are not responsible for an incorrect address provided by customer. \n\nWe cannot be responsible for any delays by USPS, late pickups/ lost packages/ or delayed shipments. We can only go on the same information they provide to us on their websites, although if there is an issue I am always more than willing to help as much as I can!",
                "policy_refunds": "â¥RETURN POLICY\nDamaged Goods/Broken Products: \nPlease contact us within 48 hours after package is delivered. The sooner you let us know there is an issue the faster we can get it fixed. We will gladly send replacement item/s if we receive photos to verify the damage. If photo&#39;s can&#39;t be sent than we will not replace the item.  \n\nI will accept refund requests within 24 hours of ordering, as long as your order has not been started.\n\nOnce item is shipped/or started i can not process refunds. \n\nI will not issue a refund for orders that are completed correctly, especially personalized items.  Please read the listings and ask any questions you may have before making purchase.",
                "policy_additional": "â¥COLORS\nI do my best to represent all colors accurately. However, colors vary between computer monitors, and I can&#39;t guarantee the colors on your screen.\n\nâ¥CUSTOM REQUESTS\nIf you have something in mind and would like to see it come to life please feel free to contact us! \n\nOur items are handmade with good quality vinyl. They are not to be put in the dishwasher. Hand wash only.\n\nGive good feedback if you love your item/s and if for some reason you are not happy with your item please be sure to contact me so I can help you fix whatever issues you may have. I want you as the customer to be happy!! :)",
